import {Button, CardBody, CardImg, Card, CardSubtitle, CardText, CardTitle} from "reactstrap";
import React from "react";

function MyCard (props) {
    const {
        imgCard,
        title,
        description,
    } = props;
    return (
    <Card>
        <CardImg
            alt="Card image cap"
            src={imgCard}
            top
            width="25%"
            className=""
        />
        <CardBody>
            <CardTitle tag="h5">
                {title}
            </CardTitle>
            <CardText>
                {description}
            </CardText>
            <Button>
                Button
            </Button>
        </CardBody>
    </Card>
    );
}
export default MyCard;
